import React from 'react';
import axios from 'axios';
import {useState} from 'react';

function GetAllAccounts() {

    const [data, setData] = useState([])

    axios.get('http://localhost:8080/accounts/')
        .then(res=> {
            setData(res.data);
        })

    if(data != null) {
        return (
            <h2>{data}</h2>
        )
    }
        return(
        <h2>error</h2>
    )
}

export default GetAllAccounts;
